import React from 'react';
import Dashboard from './Dashboard';
import { connect } from 'react-redux';
import {getProductsShop} from '../../redux/shop_reducer';

class OrderManage extends React.Component
{
    render()
    {
        return(
            <div>
                <div className="col-xs-3 col-sm-3 col-md-3 col-lg-3">
                    <Dashboard/>
                </div>
            
                <div className="col-xs-9 col-sm-9 col-md-9 col-lg-9">
                    
                    <div role="tabpanel">
                    
                        <ul className="nav nav-tabs" role="tablist">
                            <li role="presentation" className="active">
                                <a href="#home" aria-controls="home" role="tab" data-toggle="tab">home</a>
                            </li>
                            <li role="presentation">
                                <a href="#tab" aria-controls="tab1" role="tab" data-toggle="tab">tab</a>
                            </li>
                        </ul>
                    
                    
                        <div class="tab-content">
                            <div role="tabpanel" class="tab-pane active" id="home">...</div>
                            <div role="tabpanel" class="tab-pane" id="tab">abc</div>
                        </div>
                    </div>
                    
                </div>
            </div>
        );
        
        
        
    }
}

const mapStateToProps = (state) =>
{
    return{
        products: state.shopState.products,
    }
}

const mapDispatchToProps = (dispath) =>
{
    localStorage.getItem('shop_id')
    return{
        getProductsShop: (shop_id)=>dispath(getProductsShop(shop_id)),
    }
}

export default connect(mapStateToProps,mapDispatchToProps)(OrderManage);
